import React from "react";
import "./Card.css";
function Card() {
  return (
    <div className="card-wrapper">
      <div className="row">
        <div className="col-sm-4"></div>
        <div className="col-sm-2"></div>
      </div>
    </div>
  );
}

export default Card;
